-- ----------------------------
--  Table structure for `statistics`
-- ----------------------------
DROP TABLE IF EXISTS `statistics`;
CREATE TABLE `statistics` (
  `state_id` bigint(100) NOT NULL AUTO_INCREMENT COMMENT 'รหัสไอดีหลัก',
  `action_datetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'วันเวลา',
  `action` enum('login','add','update','delete','logout') COLLATE utf8_unicode_ci DEFAULT 'login',
  `path` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Path หรือ Method ที่ทำ',
  `user_id` int(11) DEFAULT '0' COMMENT 'รหัสผู้ใช้งาน',
  `status` enum('success','failed') COLLATE utf8_unicode_ci DEFAULT 'failed',
  `state_note` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'หมายเหตุ',
  PRIMARY KEY (`state_id`),
  UNIQUE KEY `state_id` (`state_id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=151 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=COMPACT COMMENT='สถิติ';

